INSERT INTO `comment_post` VALUES (6,'Khét thế','2023-04-29 20:35:55.535000',5,11,6),(7,'Mới đây, những người yêu thích bộ môn nhiếp ảnh như vỡ òa khi mà hãng Canon ra mắt một siêu phẩm mới máy ảnh Canon EOS 5D Mark IV.','2023-04-29 20:42:17.242000',4,13,7),(8,'Máy ảnh này có trọng lượng bao gồm cả pin là 890g. Thân máy được làm bằng hợp kim ma giê cao cấp, sử dụng các lớp keo cao su dán kín tại những khớp nối khung máy đảm bảo kháng nước và chiu thời tiết. Về bề ngoài hầu như không có gì thay đổi so với người đàn anh 5 D Mark III.','2023-04-29 20:58:01.368000',3,13,7),(9,'Sách này rất hay, mặc dù chưa đọc lần nào nhưng mà tôi rất là xúc động. Vẫn luôn ủng hộ và tặng shop 1 sao','2023-04-29 20:58:46.825000',1,13,6),(10,'Nice','2023-05-02 02:44:34.978000',4,9,7),(11,'Từ nhỏ đến lớn chỉ ăn mỗi loại mì này, phải nói là tuyệt phẩm trần gian','2023-05-09 00:57:01.062000',5,20,10),(12,'Ôi những kỷ niệm ấu thơ ùa về, mình cứ đi tìm những quyển này mãi mà không thấy. Cảm ơn Fahasa đã đăng bán, mà giá cũng rẻ nữa. Mình sẽ ủng hộ dài dài, cho Fahasa 5 sao luôn ?','2023-05-10 00:05:43.018000',5,20,6),(13,'Thiết kế hiện đại, nhỏ gọn, dễ dàng tháo lắp, phù hợp sử dụng trong nhà.\nChất lượng phân giải hình ảnh sắc nét, không bị mờ nhòe khi phóng to nhờ ​​độ phân giải 2560 x 1440p.','2023-05-10 01:11:02.975000',5,20,11),(14,'Camera thông minh Xiaomi PTZ (Phiên bản 2K) sử dụng ống kính góc rộng 110° kết hợp với khả năng xoay 360° theo chiều ngang và 108° theo chiều dọc. Bên cạnh đó Xioami cũng nâng cấp ống kính lên 6P cho hiệu ứng hình ảnh tốt hơn. Vì vậy chỉ với 1 camera duy nhất, người dùng có thể quan sát toàn bộ căn phòng.','2023-05-10 01:11:43.234000',4,11,11),(15,'Robot hút bụi thông minh Dreame D10s Plus có lực hút lớn 5000Pa, giúp hút mọi bụi bẩn và mảnh vụn ra khỏi thảm hay trên sàn nhà một cách hiệu quả, bên cạnh đó robot còn được nâng cấp với bàn chải cao su chống rối tóc và lông thú cưng. Ngoài ra, D10s Plus mang đến cho bạn khả năng làm sạch toàn diện nhờ 3 chế độ làm sạch, 3 cấp độ kiểm soát lưu lượng nước và 4 cấp độ hút.','2023-05-10 01:12:51.264000',5,11,12),(16,'Sản phẩm không đúng như những gì tôi kỳ vọng','2023-05-10 01:13:54.737000',1,9,12),(17,'Cấu hình hút bụi DualBoost 1.0 của D10s Plus thu thập tóc, bụi bẩn và mảnh vụn một cách nhanh chóng và hiệu quả mà không bị tắc. Có D10s Plus giúp bạn tiết kiệm thời gian, việc dọn dẹp trở lên dễ dàng hơn.','2023-05-10 01:14:25.119000',4,20,12),(18,'Nice','2023-05-30 14:18:58.869000',5,20,15),(19,'Đây là thương hiệu sữa rất phù hợp với trẻ em Việt, được nhiều bố mẹ tin dùng cho con yêu của mình. Sữa bột Optimum Gold số 4 lon 850g giúp trẻ 2 - 6 tuổi hấp thu các dưỡng chất thiết yếu.','2023-05-30 14:44:13.241000',4,20,15),(20,'Tôm ngon nấu với mì mềm\nChồng chan vợ húp gật đầu khen ngon','2023-05-30 23:59:23.952000',4,18,10),(21,'Làm thêm chai Sting nữa là tuyệt, mong sốp tặng kèm một chai sì ting 2 tẩy','2023-05-31 00:00:13.907000',2,18,10),(22,'Quyển sách này thật là bổ ích','2023-06-18 01:12:38.558000',5,20,23),(23,'Chất liệu vải thoáng mát, tuyệt vời','2023-06-18 01:13:08.870000',5,20,24),(24,'thoải mái và dễ chịu','2023-06-18 01:13:42.422000',5,20,22),(25,'đẹp, sang, xịn, mịn','2023-06-18 01:20:30.598000',5,20,21),(26,'Màn hình đẹp','2023-06-18 01:38:47.097000',5,20,18),(27,'Giao hàng chậm nên cho 3 sao','2023-06-18 01:39:51.020000',3,15,18);
