INSERT INTO `promotion_program` VALUES (1,'https://res.cloudinary.com/dec25/image/upload/v1687007435/open-market/atlv27scqnqusqoopumc.png','Hàng công nghệ giảm đến 70%','Cực phẩm giá sốc từ Bắc vào Nam','<h3><strong style=\"background-color: transparent;\">1. Smart Tivi QLED 4K Samsung 43 Inch: giảm 31.75% (từ 18,300,000 giảm còn 12,490,000</strong></h3><p>Smart Tivi QLED 4K Samsung 43 inch QA43Q60AAKXXV sở hữu thiết kế AirSlim với kiểu dáng thanh mảnh với độ mỏng vô cùng nổi bật, kết hợp cùng chân đế chuyên dụng, cứng cáp phù hợp ở mọi không gian trong ngôi nhà.</p><p>Smart Tivi có độ phân giải Ultra HD 4K được trang bị kích thước màn hình lớn, được trang bị thêm đèn nền Dual LED giúp tăng cường độ tương phản, cho hình ảnh hiển thị chất lượng và sắc nét chi tiết đến từng hình ảnh nhỏ.&nbsp;</p><p>Không những vậy nhờ vào, công nghệ nâng cấp chất lượng hình ảnh lên chuẩn 4K. Ngoài ra, tivi còn được tích hợp công nghệ Quantum HDR, cho ra những khung hình chuẩn điện ảnh siêu thực,&nbsp;rực rỡ, sống động trong khung hình của bạn. Chưa dừng lại đó, tivi còn có công nghệ Quantum HDR, cho ra những khung hình chuẩn điện ảnh siêu thực,&nbsp;rực rỡ.</p><p><span style=\"background-color: transparent;\"><img src=\"https://phongvu.vn/cong-nghe/wp-content/uploads/sites/2/2022/06/smart-tivi-qled-4k-samsung-43-inch-qa43q60aakxxv-1.jpg\" alt=\"smart tivi qled 4k samsung 43 inch qa43q60aakxxv 1\" height=\"405\" width=\"586\"></span></p><p>Bên cạnh đó, Smart Tivi QLED 4K Samsung 43” còn sử dụng trí tuệ nhân tạo với công nghệ Adaptive Sound, giúp&nbsp;phân tích và tinh chỉnh âm thanh để phù hợp với từng nội dung hiển thị.</p><p>Tin vui cực hot Smart Tivi QLED 4K Samsung 43 Inch QA43Q60AAKXXV đang có ưu đãi cực hấp dẫn giảm đến 5,810,000đ.</p>','2023-06-10 20:10:00','2023-07-28 20:10:00',2,70,50000,4,';19;',1,'2023-06-17 20:10:36'),(2,'https://res.cloudinary.com/dec25/image/upload/v1687009133/open-market/o0lgknn4u5jsfj3izkm7.jpg','GIẢM giá 30%-50% khi mua sách tại Fahasa','Cùng FAHASA khởi động năm học mới','<h2><strong>Mã giảm giá Fahasa, voucher Fahasa khuyến mãi.</strong></h2><p class=\"ql-align-justify\"><strong>Fahasa</strong>&nbsp;hiện là một trong những thương hiệu sách lớn, với nhiều cửa hàng trên khắp các tỉnh/thành phố trên khắp cả nước. Ngoài hệ thống cửa hàng ra, Fahasa còn bán sách online trên website chính thức&nbsp;<span style=\"color: rgb(51, 153, 102);\">Fahasa.com</span>. Bạn có thể ngồi nhà mà vẫn mua sách online Fahasa. Mua sách online trên Fahasa thường có giá rẻ hơn mua tại cửa hàng. Vì bạn sử dụng được các&nbsp;<span style=\"color: rgb(51, 153, 102);\">mã giảm giá Fahasa</span>&nbsp;hoặc Voucher Fahasa giảm giá. Nếu bạn mua số lượng nhiều, thì có th được miễn phí ship đến tận nơi.</p><p><em><img src=\"https://voucherbox.vn/wp-content/uploads/2022/05/ma-giam-gia-fahasa-40k-2.jpg\" alt=\"Mã giảm giá Fahasa 40k\" height=\"354\" width=\"700\">Mã giảm giá Fahasa 40k</em></p><p class=\"ql-align-justify\">Fahasa thường tung ra những chương trình khuyến mại, giảm giá sách vào những dịp lễ, tết hoặc đầu năm học mới. Khi sử dụng&nbsp;<em>mã giảm giá Fahasa</em>&nbsp;kết với dịp&nbsp;<em>Fahasa khuyến mãi</em>. Sẽ giúp bạn tiết kiệm được kha khá tiền khi chọn mua sách tại các cửa hàng Fahasa.</p><p><br></p>','2023-06-09 20:38:00','2023-07-28 20:38:00',2,30,40000,6,'ALL',1,'2023-06-17 20:38:54'),(3,'https://res.cloudinary.com/dec25/image/upload/v1687009359/open-market/pzjmmzz4zwn6tcxkeslm.jpg','Giảm giá đến 50% cho nhiều mặt hàng','Xả kho giá sốc','<h1><strong>Xả kho giá sốc - Giảm giá đến 50% cho nhiều mặt hàng</strong></h1><h2>Trong tháng 6 này, Bách Hóa XANH diễn ra sự kiện Xả kho Online giá sốc với sản phẩm của Johnson’s Baby khuyến mãi đến 50% dành cho khách hàng mua online.</h2><p><br></p><p class=\"ql-align-justify\"><img src=\"https://cdn.tgdd.vn/Files/2020/06/25/1265446/xa-kho-gia-soc-giam-gia-den-50-cho-nhieu-mat-hang-202006251058203105.jpg\" alt=\"Xả kho giá sốc Bách hóa XANH\" height=\"140\" width=\"360\"></p><p class=\"ql-align-justify\">Chương trình&nbsp;<strong>Xả kho giá sốc</strong>&nbsp;áp dụng cho khách hàng&nbsp;<strong>đặt mua online tại website BachhoaXANH.com ở khu vực TP.HCM</strong>&nbsp;(trừ Quận 2, Quận 9, Bình Thạnh và Thủ Đức). Với nhiều khuyến mãi từ&nbsp;<strong>25-50%</strong>&nbsp;áp dụng cho nhiều mặt hàng, trong đó các sản phẩm&nbsp;<a href=\"https://www.bachhoaxanh.com/dau-goi-cho-be-johnsons-baby\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 100, 194);\">Dầu gội Johnson’s Baby</a>&nbsp;được giảm đến&nbsp;<strong>40%</strong>. Nếu bạn là một tín đồ của thương hiệu Johnson\'s thì không thể nào bỏ qua chương trình này.</p><p><br></p>','2023-06-10 20:42:00','2023-07-31 20:42:00',2,50,30000,9,';10;9;8;',1,'2023-06-17 20:42:40'),(4,'https://res.cloudinary.com/dec25/image/upload/v1687009472/open-market/q2ecjlabhmnvhzaivzqj.jpg','Giảm giá tháng 6','CHƯƠNG TRÌNH GIÁ SỐC','<h1><strong>Xả kho giá sốc - Giảm giá đến 50% cho nhiều mặt hàng</strong></h1><h2>Trong tháng 6 này, Bách Hóa XANH diễn ra sự kiện Xả kho Online giá sốc với sản phẩm của Johnson’s Baby khuyến mãi đến 50% dành cho khách hàng mua online.</h2><p><br></p><p class=\"ql-align-justify\"><img src=\"https://cdn.tgdd.vn/Files/2020/06/25/1265446/xa-kho-gia-soc-giam-gia-den-50-cho-nhieu-mat-hang-202006251058203105.jpg\" alt=\"Xả kho giá sốc Bách hóa XANH\" height=\"140\" width=\"360\"></p><p class=\"ql-align-justify\">Chương trình&nbsp;<strong>Xả kho giá sốc</strong>&nbsp;áp dụng cho khách hàng&nbsp;<strong>đặt mua online tại website BachhoaXANH.com ở khu vực TP.HCM</strong>&nbsp;(trừ Quận 2, Quận 9, Bình Thạnh và Thủ Đức). Với nhiều khuyến mãi từ&nbsp;<strong>25-50%</strong>&nbsp;áp dụng cho nhiều mặt hàng, trong đó các sản phẩm&nbsp;<a href=\"https://www.bachhoaxanh.com/dau-goi-cho-be-johnsons-baby\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 100, 194);\">Dầu gội Johnson’s Baby</a>&nbsp;được giảm đến&nbsp;<strong>40%</strong>. Nếu bạn là một tín đồ của thương hiệu Johnson\'s thì không thể nào bỏ qua chương trình này.</p><p><br></p>','2023-06-01 20:44:00','2023-06-30 20:44:00',2,50,30000,9,'ALL',1,'2023-06-17 20:44:33'),(5,'https://res.cloudinary.com/dec25/image/upload/v1687009842/open-market/hq02dtdezwjs2to3rk7e.webp','Giảm giá đặc biệt trong tháng 6 này','Xiaomi Sale sập sàn','<p>Ngày 6/6 này tại gian hàng chính thức trên Shopee và Lazada, Xiaomi sẽ tung ra hàng loạt ưu đãi khủng, giảm đến 40% cho các sản phẩm nổi bật của hãng. Trong số này phải kể đến điện thoại POCO, Redmi series vốn được nhiều người dùng đánh giá cao, đạt doanh số cực tốt kể từ khi ra mắt.</p><p><a href=\"https://genk.mediacdn.vn/139269124445442048/2023/6/5/srdgnsrgn-16859541639771930673180-1685955143126-16859551437931287314777.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(229, 44, 75);\"><img src=\"https://genk.mediacdn.vn/139269124445442048/2023/6/5/srdgnsrgn-16859541639771930673180-1685955143126-16859551437931287314777.jpg\" alt=\"Fan Xiaomi xem ngay loạt điện thoại, đồ gia dụng sắp giảm đến 40% đợt sale ngày đôi 6/6 này - Ảnh 1.\"></a></p><p><br></p>','2023-06-01 20:50:00','2023-06-30 20:50:00',2,40,60000,10,'ALL',1,'2023-06-17 20:50:43'),(6,'https://res.cloudinary.com/dec25/image/upload/v1687009989/open-market/vxtbgcvoi2pf2dadbfcw.jpg','Chào hè cùng xiaomi đến hết tháng 6','Xiaomi tưng bừng chào hè - siêu sale 50%','<p><img src=\"https://theaxo.com/wp-content/uploads/2020/09/9.9-3H-1024x1024.jpg\" alt=\"Xiaomi 9.9 Sale\" height=\"1024\" width=\"1024\"><img src=\"https://theaxo.com/wp-content/uploads/2020/09/9.9-band5-1024x1024.jpg\" alt=\"Xiaomi 9.9 Sale\" height=\"1024\" width=\"1024\"></p><p>Featured Xiaomi products on the Xiaomi 9.9 Sale include the&nbsp;<a href=\"https://theaxo.com/2020/redmi-note-9s-review/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(214, 0, 57);\">Redmi Note 9S</a>,&nbsp;<a href=\"https://theaxo.com/2020/redmi-note-9-series-malaysia/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(214, 0, 57);\">Redmi Note 9 Pro</a>,&nbsp;<a href=\"https://theaxo.com/2020/xiaomi-mi-10-series-launched-from-rm-2799-pre-order-begins-today/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(214, 0, 57);\">Mi 10</a>,&nbsp;<a href=\"https://theaxo.com/2020/xiaomi-redmi-9a-redmi-9c-my-launch/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(214, 0, 57);\">Redmi 9A, Redmi 9C</a>, Mi Robot Vacuum-Mop, Mi Home Security Camera 360 1080P, Mi Air Purifier 3H and many more.</p>','2023-05-05 20:52:00','2023-06-30 20:52:00',2,50,90000,10,'ALL',1,'2023-06-17 20:53:10');
