INSERT INTO `sale_post` VALUES (5,'https://res.cloudinary.com/dec25/image/upload/v1682774585/open-market/umpsopbtlrnafm02qvzp.jpg','Xiaomi','2023-04-29 20:23:05.420000','<p class=\"ql-align-justify\">Đôi mắt là “cửa sổ tâm hồn”, là tài sản quý giá nhất của mỗi người, vì thế bạn cần chăm sóc hàng ngày.&nbsp;<strong>Đèn Bàn Thông Minh Mi Led Desk Lamp 1S</strong>&nbsp;được nâng cấp về cường độ ánh sáng, chế độ màu sắc giúp bảo vệ đôi mắt hiệu quả, đồng hành cùng bạn trong học tập, trong công việc, trong cuộc sống gia đình.</p><p class=\"ql-align-justify\"><img src=\"https://mivietnam.vn/wp-content/uploads/2021/06/MIVIETNAM-DEN-BAN-THONG-MINH-MI-LED-DESK-LAMP-1S-01.jpg\" alt=\"Đèn Bàn Thông Minh Mi Led Desk Lamp 1S\" height=\"631\" width=\"850\"></p><h2 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Thiết Kế Tinh Tế, Trang Nhã, Tối Giản</strong></h2><p class=\"ql-align-justify\"><strong>Đèn Bàn Thông Minh Mi Led Desk Lamp 1S</strong>&nbsp;có kích thước 162x162x479 mm dạng thanh thẳng, không chiếm nhiều diện tích không gian, có thể bố trí trên bàn làm việc, đèn phòng ngủ, toát lên vẻ sang trọng, hiện đại cho không gian nhà bạn. Phần cánh đèn có thể mở rộng, hợp với trục thân đèn một góc 135 độ, tầm chiếu sáng rộng. Khi không dùng nữa, bạn có thể gập lại vô cùng gọn gàng, tiện lợi.</p><p class=\"ql-align-justify\"><img src=\"https://mivietnam.vn/wp-content/uploads/2021/06/MIVIETNAM-DEN-BAN-THONG-MINH-MI-LED-DESK-LAMP-1S-12.jpg\" alt=\"Đèn Bàn Thông Minh Mi Led Desk Lamp 1S\" height=\"494\" width=\"850\"></p><p class=\"ql-align-justify\"><img src=\"https://mivietnam.vn/wp-content/uploads/2021/06/MIVIETNAM-DEN-BAN-THONG-MINH-MI-LED-DESK-LAMP-1S-02.jpg\" alt=\"Đèn Bàn Thông Minh Mi Led Desk Lamp 1S\" height=\"465\" width=\"850\"></p><p class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Sản phẩm liên quan:</strong></p><ul><li class=\"ql-align-justify\"><a href=\"https://mivietnam.vn/den-ban-thong-minh-mijia-desk-lamp-lite/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(85, 85, 85);\">Đèn Bàn Mijia Desk Lamp Lite – Mi Việt Nam Hàng Chính Hãng (mivietnam.vn)</a></li><li class=\"ql-align-justify\"><br></li><li class=\"ql-align-justify\"><a href=\"https://mivietnam.vn/den-ngu-nhieu-mau-xiaomi-mijia-mjctd02yl/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(85, 85, 85);\">Đèn ngủ nhiều màu Mijia MJCTD02YL – Mi Việt Nam (mivietnam.vn)</a></li><li class=\"ql-align-justify\"><br></li></ul><h2 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Ánh Sáng Đồng Đều, Tự Nhiên, Cơ Chế Bảo Vệ Mắt</strong></h2><p class=\"ql-align-justify\"><strong>Đèn Bàn Thông Minh Mi Led Desk Lamp 1S</strong>&nbsp;được trang bị thấu kính quang học Fresnel công nghệ hiện đại, tiên tiến bậc nhất cho thiết bị chiếu sáng. Công suất phát sáng của đèn (Quang thông) đạt 520 Lumens, độ rọi 1131 Lux, nhiệt độ màu 2600K-5000K, đèn có ánh sáng tự nhiên, các tia sáng đồng đều bảo vệ mắt bạn khi làm việc, đọc sách báo, sử dụng máy tính…</p>',600000,1000000,1,'Trung Quốc','Trung Quốc','Đèn học thông minh Xiaomi',10,4,2),(6,'https://res.cloudinary.com/dec25/image/upload/v1682775128/open-market/fjzjanwbnwqibsprus2c.jpg','NSB Trẻ','2023-04-29 20:32:08.400000','<h3><a href=\"https://sachhay24h.com/sach-hay-nen-doc.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(255, 255, 255);\">SÁCH HAY NÊN ĐỌC</a></h3><h1><a href=\"https://sachhay24h.com/review-sach-mat-biec-nguyen-nhat-anh-a642.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(2, 90, 182);\">Review sách Mắt Biếc – Nguyễn Nhật Ánh</a></h1><p>“<a href=\"https://sachhay24h.com/review-sach-mat-biec-nguyen-nhat-anh-a642.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(4, 113, 231);\"><strong>Mắt biếc</strong></a>” – một tâm hồn lãng mạn, một tình yêu nồng nàn nhưng lại có kết cục buồn. Cuốn sách “Mắt biếc” của Nguyễn Nhật Ánh thực sự đã chạm vào tâm hồn của những kẻ đang yêu, đã và đang dành cả thanh xuân, tuổi trẻ của mình để yêu đơn phương một người nào đó. Không còn xa lạ với những câu chuyện tình yêu đơn phương của Nguyễn Nhật Ánh nhưng đến với “Mắt biếc” việc xây dựng hình tượng và nội dung có phần khác. Vẫn với những ngôn từ giản đơn, gần gũi, cuốn sách sẽ gieo lại trong lòng độc giả một nỗi niềm nuối tiếc, chơi vơi, vừa yêu vừa giận.</p><p class=\"ql-align-center\"><img src=\"https://sachhay24h.com/uploads/images/2020/T5/480/top-7-sach-nguyen-nhat-anh.PNG\" alt=\"Review sách Mắt biếc của nhà văn Nguyễn Nhật Ánh\"></p><p class=\"ql-align-center\"><a href=\"https://gotrackecom.info/v0/PiU50JPm4ml6Cgch1E-veQ?url=https%3A%2F%2Ftiki.vn%2Fsearch%3Fq%3DM%25E1%25BA%25AFt%2Bbi%25E1%25BA%25BFc%26_lc%3DVk4wMzQwMjAwMDM%3D&amp;aff_sub3=sh24-tiki-117\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(221, 66, 0); color: rgb(4, 113, 231);\">Mua tại Tiki</a>&nbsp;<a href=\"https://go.isclix.com/deep_link/4843645303116132451?url=https%3A%2F%2Fwww.fahasa.com%2Fcatalogsearch%2Fresult%2F%3Fq%3Dmat+biec\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(14, 127, 0); color: rgb(4, 113, 231);\">Mua tại Fahasa</a>&nbsp;<a href=\"https://gotrackecom.info/v0/PiU50JPm4ml6Cgch1E-veQ?url=https%3A%2F%2Fshopee.vn%2Fsearch%3Fkeyword%3Dm%25E1%25BA%25AFt%2520bi%25E1%25BA%25BFc&amp;aff_sub=sh24-shopee-117\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(121, 190, 55); color: rgb(4, 113, 231);\">Mua tại Shopee</a></p><ul><li><a href=\"https://sachhay24h.com/review-co-hai-con-meo-ngoi-ben-cua-so-nguyen-nhat-anh-a677.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(4, 113, 231);\"><em>Review Có Hai Con Mèo Ngồi Bên Cửa Sổ - Nguyễn Nhật Ánh</em></a></li><li><a href=\"https://sachhay24h.com/bao-gio-cho-den-thang-muoi-don-gian-nhung-kho-quen-a627.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(4, 113, 231);\"><em>Bao giờ cho đến tháng mười - Đơn giản nhưng khó quên</em></a></li></ul><h2><strong>1. Đôi nét về tác giả Nguyễn Nhật Ánh</strong></h2><p><strong>Nhà văn Nguyễn Nhật Ánh</strong>&nbsp;sinh năm 1955 tại Quảng Nam. Ông được coi là một trong những nhà văn thành công nhất với hơn 100 tác phẩm các thể loại. Nguyễn Nhật Ánh trước khi trở thành nhà văn nổi tiếng đã từng có thời gian đi dạy học, viết báo với nhiều bút danh khác nhau như Lê Duy Cật, Sóc Phương Đông, Chu Đinh Ngạn,…</p><p class=\"ql-align-center\"><img src=\"https://sachhay24h.com/uploads/images/mat-biec-1.jpg\" alt=\"Chân dung Nhà văn Nguyễn Ngọc Ánh\"></p><p class=\"ql-align-center\"><em>Chân dung tác giả Nguyễn Ngọc Ánh</em></p><p>Truyện của ông được tái bản liên tục và làm say lòng bao thế hệ độc giả như Mắt biếc, Còn chút gì để nhớ, Cô gái đến từ hôm qua, Kính vạn hoa,…Nhiều tác phẩm trong số đó đã được chuyển thể thành các bộ phim truyền hình hoặc điển ảnh nổi tiếng được rất nhiều người xem đón nhận.</p><p>Xem thêm:&nbsp;<a href=\"https://sachhay24h.com/top-7-cuon-truyen-hay-nhat-cua-nha-van-nguyen-nhat-anh-a480.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(4, 113, 231);\"><em>Top 7 cuốn truyện hay nhất của nhà văn Nguyễn Nhật Ánh</em></a></p>',40000,200000,1,'nxbTre.Inc','Việt Nam','Tiểu thuyết Nguyễn Nhật Ánh',6,10,4),(7,'https://res.cloudinary.com/dec25/image/upload/v1682775600/open-market/vxajdhxfgftzopn3lbo0.jpg','Canon','2023-04-29 20:40:00.768000','<p>Mới đây, những người yêu thích bộ môn nhiếp ảnh như vỡ òa khi mà hãng Canon ra mắt một siêu phẩm mới&nbsp;<a href=\"https://binhminhdigital.com/may-anh/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(68, 68, 68);\"><strong>máy ảnh</strong></a><strong>&nbsp;</strong>Canon EOS 5D Mark IV. Chiếc DSLR này đã đáp ứng được sự kỳ vọng mà tất cả mọi người mong đợi với những cải tiến vượt bậc bởi những công nghệ tiên tiến nhất hiện nay đem đến cho người dùng những tiện ích nổi trội.&nbsp;</p><p><span style=\"color: rgb(68, 68, 68);\">&nbsp;</span></p><p class=\"ql-align-center\"><img src=\"https://binhminhdigital.com/StoreData/Product/6472/Canon-EOS-5D-Mark-IV-binhminhdigital4.jpg\" alt=\"Máy Ảnh Canon EOS 5D Mark IV (Body) - hàng nhập khẩu\"></p><p class=\"ql-align-center\"><br></p><p><span style=\"color: rgb(68, 68, 68);\">&nbsp;</span></p><p><strong><em>Thiết kế</em></strong></p><p>&nbsp;</p><p>Máy ảnh&nbsp;này có trọng lượng bao gồm cả pin là 890g. Thân máy được làm bằng hợp kim ma giê cao cấp, sử dụng các lớp keo cao su dán kín tại những khớp nối khung máy đảm bảo kháng nước và chiu thời tiết. Về bề ngoài hầu như không có gì thay đổi so với người đàn anh 5 D Mark III.</p><p>&nbsp;</p><p class=\"ql-align-center\"><img src=\"https://binhminhdigital.com/StoreData/Product/6472/Canon-EOS-5D-Mark-IV-binhminhdigital.jpg\" alt=\"Máy Ảnh Canon EOS 5D Mark IV (Body) - hàng nhập khẩu\"></p><p><br></p>',2000000,6000000,1,'CanonFac','US','Camera chuyên nghiệp - Canon ',8,12,4),(8,'https://res.cloudinary.com/dec25/image/upload/v1683566212/open-market/zbf3m3a7ln5sbne0bueo.jpg','Coca Cola','2023-05-09 00:16:52.313000','<h3 class=\"ql-align-justify\"><strong>Đôi nét về thương hiệu</strong></h3><p class=\"ql-align-justify\">Coca-Cola (còn được gọi tắt là Coke) là thương&nbsp;hiệu nước giải khát nổi tiếng hàng đầu thế giới được thành lập năm 1893 tại Mỹ. Qua hơn 100 năm phát triển, tập đoàn Coca-cola hiện đang hoạt động trên&nbsp;khắp thế giới và không ngừng gặt hái nhiều đã thành công không chỉ có&nbsp;nước giải khát mà cón có các&nbsp;loại nước uống khác&nbsp;như sữa trái cây, nước suối, nước trà, soda,... với nhiều nhãn hiệu khác nhau như: Sprite, Fanta,, Nutriboost, Aquarius, Fuze Tea, Dasani,...</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><img src=\"https://cdn.tgdd.vn/Products/Images//2443/76451/bhx/files/SLIDE(1).jpg\" alt=\"6 lon nước ngọt Coca Cola 320ml 0\"></p><h3 class=\"ql-align-justify\"><strong>Thành phần dinh dưỡng trong sản phẩm</strong></h3><p class=\"ql-align-justify\">Các sản phẩm nước ngọt Coca cola có thành phần chính bao gồm: Nước bão hòa CO2, đường HFCS, đường mía, màu tự nhiên (caramen nhóm IV), chất điều chỉnh độ acid, hương cola tự nhiên và caffeine.&nbsp;</p><p class=\"ql-align-justify\">Ngoài ra, sản phẩm cung cấp khoảng 42kcal trên 100ml nước ngọt.</p><h3 class=\"ql-align-justify\"><strong>Tác dụng của sản phẩm với sức khỏe</strong></h3><p class=\"ql-align-justify\">Sản phẩm nếu dùng với liều lượng vừa đủ, đúng hướng dẫn của nhà sản xuất sẽ không chỉ giúp giải tỏa cơn khát mà còn cung cấp cho bạn nguồn năng lượng cao cùng hàm lượng khoáng chất dồi dào, cho bạn khơi lại hứng khởi ngay từ ngụm đầu tiên, phù hợp&nbsp;sử dụng với các hoạt động ngoài trời&nbsp;và các hoạt động thể thao...</p><h3 class=\"ql-align-justify\"><strong>Lưu ý khi sử dụng và cách bảo quản sản phẩm</strong></h3><p class=\"ql-align-justify\">Sản phẩm phù hợp sử dụng ngay và ngon hơn khi uống lạnh. Lưu ý, bạn không nên dùng nước ngọt thường xuyên vì sẽ gây ảnh hưởng xấu đến sức khỏe của bạn và sản phẩm không phù hợp cho trẻ nhỏ.&nbsp;</p><p class=\"ql-align-justify\">Nước ngọt Coca cola cần được bảo quản ở nơi khô ráo, thoáng mát.</p><p class=\"ql-align-justify\"><img src=\"https://cdn.tgdd.vn/Products/Images//2443/125398/bhx/files/coca.jpg\" alt=\"6 lon nước ngọt Coca Cola 320ml 1\"></p><h3 class=\"ql-align-justify\"><strong>Ưu điểm khi mua sản phẩm tại Bách hoá XANH</strong></h3><p class=\"ql-align-justify\">Các dòng sản phẩm nước ngọt và nước giải khát của Coca Cola&nbsp;đều đang được phân phối chính hãng tại Bách hóa XANH với giá thành cực&nbsp;tốt. Các sản phẩm còn được cam kết chính hãng 100%, bảo đảm&nbsp;nguồn gốc xuất xứ, mua hàng online với&nbsp;nhiều ưu đãi kèm theo dịch vụ tốt, giao hàng nhanh chóng tận nơi.</p><p class=\"ql-align-justify\"><strong>Xem thêm:&nbsp;</strong></p><ul><li class=\"ql-align-justify\"><a href=\"https://www.bachhoaxanh.com/kinh-nghiem-hay/coca-cola-nuoc-giai-khat-hang-dau-the-gioi-1182374\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 138, 214);\">Coca Cola - Tất tần tật về nước giải khát cả thế giới ưa chuộng</a></li><li class=\"ql-align-justify\"><a href=\"https://www.bachhoaxanh.com/kinh-nghiem-hay/cong-dung-tuyet-voi-cua-coca-cola-1010913\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 138, 214);\">Công dụng tuyệt vời của Coca Cola</a></li></ul><p><br></p>',200000,500000,1,'Coca Cola','USA','Nước ngọt Cocacola - Thùng 24 lon',9,6,2),(9,'https://res.cloudinary.com/dec25/image/upload/v1683566549/open-market/z1hhdvv3lv4wo5mskub7.png','OMO','2023-05-09 00:22:29.812000','<h3><strong>Đôi nét về thương hiệu&nbsp;</strong></h3><p>Omo được thành lập và phát triển bởi Tập đoàn Unilever, đây là thương hiệu bột giặt, nước giặt được người tiêu dùng yêu thích trên thị trường. Không chỉ chất lượng, đa dạng loại sản phẩm phù hợp với nhu cầu sử dụng của người dùng mà giá cả còn ổn định và an toàn.</p><p><img src=\"https://cdn.tgdd.vn/Products/Images//2464/222103/bhx/files/nuoc-giat-omo-matic-ben-dep-cua-truoc-luu-va-tre-tui-37kg-202005151915156936.jpg\" alt=\"Nước giặt OMO cửa trước bền màu với tinh chất lựu tre xoáy bay vết bẩn và hương thơm bền lâu túi 3.4 lít 0\"></p><h3><strong>Ưu điểm của sản phẩm</strong></h3><p>Một số ưu điểm của sản phẩm là:</p><ul><li>Dễ dàng loại vết bẩn khô cứng</li><li>Công nghệ giặt tẩy hiện đại</li><li>Giúp người dùng tiết kiệm thời gian</li><li>Hương thơm dễ chịu</li><li>Giữ màu quần áo</li></ul><h3>Hướng dẫn sử dụng</h3><p>Sử dụng khoảng 65ml cho 1 lần giặt thông thường. Điều chỉnh lượng nước giặt tương ứng với lượng quần áo và vết bẩn. Nếu có vết bẩn cứng đầu bạn có thể thoa một lượng nhỏ nước giặt trực tiếp lên vết bẩn và đổ phần nước giặt còn lại trong nắp vào máy giặt cùng với quần áo.</p><p><img src=\"https://cdn.tgdd.vn/Products/Images//2464/222103/bhx/files/nuoc-giat-omo-matic-ben-dep-cua-truoc-luu-va-tre-tui-37kg-202005151915136413.jpg\" alt=\"Nước giặt OMO cửa trước bền màu với tinh chất lựu tre xoáy bay vết bẩn và hương thơm bền lâu túi 3.4 lít 1\"></p><h3><strong>Cách bảo quản và lưu ý về sản phẩm</strong></h3><p>Bảo quản sản phẩm ở nơi khô ráo thoáng mát, đậy kín nắp sau khi dùng để tránh nước rơi vào trong. Tránh tiếp xúc trực tiếp với ánh nắng mặt trời.</p><p>Lưu ý: Kiểm tra độ bền màu trước khi sử dụng. Giặt dưới nhiệt độ thường. Để xa tầm tay trẻ em. Không được uống. Tránh tiếp xúc với mắt, nếu dính vào mắt hãy rửa kỹ với nước.</p>',120000,200000,1,'Anh','Việt Nam','Nước giặt OMO MATIC - Siêu tiết kiệm',9,4,3),(10,'https://res.cloudinary.com/dec25/image/upload/v1683566860/open-market/cdcizvwxzuibmslgigrb.jpg','ACECOOK','2023-05-09 00:27:40.180000','<p>Sản xuất: tại Việt Nam</p><p> Thành phần:&nbsp;</p><p> Vắt mì: Bột mì, dầu thực vật tinh luyện, tinh bột khoai mì biến tính, muối i-ốt, đường, chất điều vị, chất tạo xốp,....</p><p> Gói gia vị: Đường, muối, dầu thực vật, chất điều vị, gia vị (tỏi, ớt, tiêu, ngò thơm),...</p><p> Trọng lượng: 63g/ gói</p><p> Hướng dẫn sử dụng: Cho vắt mì và các gói gia vị vào tô. Chế khoảng 400ml nước sôi, đậy nắp trong 3 phút. Trộn đều và dùng.</p><p> Hướng dẫn bảo quản: Bảo quản nơi khô ráo, thoáng mát.</p><p>&nbsp;</p><p>Với <a href=\"https://www.bachhoaxanh.com/mi-hao-hao\" rel=\"noopener noreferrer\" target=\"_blank\">mì Hảo Hảo<img src=\"https://satrafoods.com.vn/uploads/Images/san-pham/thuc-pham-kho/8934563138165-5.jpg\"></a></p><p>Bạn sẽ có những trải nghiệm ẩm thực hoàn toàn khác biệt với sợi mì dai ngon kết hợp với nước súp đậm đà, mùi vị đặc trưng, mang đến cái ngon đầy xúc cảm ngay từ lúc chế biến cho đến khi thưởng thức xong.&nbsp;</p><p><br></p><p><img src=\"https://cdn.tgdd.vn/Products/Images//2565/77622/bhx/files/mi-hao-hao-tom-chua-cay-75g.png\"></p>',120000,200000,1,'Acecook','Việt Nam','Hảo Hảo tôm chua cay ACECOOK',9,6,5),(11,'https://res.cloudinary.com/dec25/image/upload/v1683619802/open-market/hhvcij1nwj3qareda2nc.webp','Xiaomi','2023-05-09 15:10:01.994000','<p><span style=\"color: rgb(102, 102, 102);\">Camera Xiaomi PTZ 2K 360° MJSXJ09CM sở hữu những nâng cấp đáng kể như góc quay rộng hơn, chất lượng hình ảnh ấn tượng hơn, hệ thống đèn hồng ngoại hỗ trợ quan sát trong bóng tối, khả năng đàm thoại 2 chiều và nhiều phương thức lưu trữ khác nhau…</span></p><h2><strong>Chất lượng hình ảnh 2K</strong></h2><p>Camera thông minh Xiaomi PTZ (Phiên bản 2K) được nâng cấp về chất lượng hình ảnh một cách đáng kể. So với các thế hệ trước độ phân giải chỉ ở mức 720P và 1080P thì phiên bản mới này độ phân giải đã lên tới 2K (2304 x 1296). Với 3 triệu điểm ảnh, chi tiết hình ảnh và video mà camera thu được sẽ tốt hơn, mượt mà, rõ ràng và chi tiết hơn.</p><h2><strong>Quan sát ban đêm với đèn hồng ngoại</strong></h2><p>Về khả năng nhìn đêm, Xiaomi đã trang bị cho Camera thông minh Xiaomi PTZ (Phiên bản 2K) với hệ thống đèn hồng ngoại 940nm cùng khẩu độ ống kính lớn F1.4 cải thiện đáng kể chất lượng ảnh sáng của hình ảnh, cho khả năng chụp ảnh tốt ngay cả trong điều kiện ánh sáng yếu, giảm nhiễu và tăng chi tiết ảnh.</p><h2><strong>Góc nhìn rộng</strong></h2><p>Camera thông minh Xiaomi PTZ (Phiên bản 2K)&nbsp;sử dụng ống kính góc rộng 110° kết hợp với khả năng xoay 360° theo chiều ngang và 108° theo chiều dọc. Bên cạnh đó Xioami cũng nâng cấp ống kính lên 6P cho hiệu ứng hình ảnh tốt hơn. Vì vậy chỉ với 1 camera duy nhất, người dùng có thể quan sát toàn bộ căn phòng.</p><p>Ngoài ra&nbsp;camera này còn được trang bị trí thông minh nhân tạo AI được cải tiến đáng kể để lọc hiệu quả các chuyển động không phải của con người, từ đó có các báo động với độ chính xác cao hơn.&nbsp;Camera thông minh Xiaomi PTZ (Phiên bản 2K)&nbsp;cũng được hỗ trợ khả năng&nbsp;gọi thoại 2 chiều&nbsp;theo thời gian thực, cho phép người dùng có thể liên lạc từ xa với người thân tại nhà, một tính năng vô cùng hữu ích</p><h2><strong>Thông số kỹ thuật</strong></h2><ul><li><strong>Mã sản phẩm:</strong>&nbsp;MJSXJ09CM</li><li><strong>Khẩu độ:</strong>&nbsp;F1.4</li><li><strong>Độ phân giải:</strong>&nbsp;2304 x 1296 (2K)</li><li><strong>Trọng lượng:</strong>&nbsp;310g</li><li><strong>Góc kinh rộng:</strong>&nbsp;110°</li><li><strong>Kích thước:</strong>&nbsp;115 x 78 x 78mm</li><li><strong>Lưu trữ:</strong>&nbsp;Micro SD ( tối đa 32GB)</li><li><strong>Thiết bị hỗ trợ:</strong>&nbsp;Android 4.4 &amp; IOS 9.0 trở lên</li></ul>',779000,1200000,1,'XiaoMi','China','Camera Xiaomi - Chính hãng Bắc Kinh',10,12,5),(12,'https://res.cloudinary.com/dec25/image/upload/v1683620175/open-market/usskx26g7rhlp3sduwap.webp','Dreame','2023-05-09 15:16:15.279000','<h2 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Những đặc điểm nổi bật Dreame D10S Plus</strong></h2><ul><li class=\"ql-align-justify\"><strong>Lực hút 5000Pa</strong>&nbsp;kết hợp cùng&nbsp;<strong>bản chải cao su</strong>&nbsp;chống rối tóc giúp hút bụi và mảnh vụn ra khỏi thảm và sàn cứng một cách hiệu quả.</li><li class=\"ql-align-justify\"><strong>Tự động hút rác&nbsp;</strong>lên túi bụi dung tích 4L cho khả năng lưu trữ lên đến 65 ngày người dùng mới cần phải thay túi rác một lần.</li><li class=\"ql-align-justify\"><strong>Camera AI + điều hướng&nbsp;LDS&nbsp;</strong>nhận diện chính xác các trở ngại trên quãng đường di chuyển từ đó giảm thiếu tối đa tình trạng mắc kẹt.</li><li class=\"ql-align-justify\"><strong>Giám sát từ xa thông qua camera tích hợp</strong>&nbsp;theo dõi quá trình hoạt động của robot một cách trực quan hay những gì đang diễn ra trong nhà.</li><li class=\"ql-align-justify\"><strong>Dung lượng pin 5200mAh</strong>&nbsp;cho khả năng hoạt động lên đến 280 phút ở chế độ tiêu chuẩn chỉ trong 1 lần sạc đầy.</li><li class=\"ql-align-justify\">Hỗ trợ điều khiển và giao tiếp với trợ lý giọng nói: Google Assistant, Amazon Alexa, Apple Siri.</li></ul><h2 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Robot hút bụi lau nhà Dreame D10s Plus có khả năng tự động dọn rác</strong></h2><p class=\"ql-align-justify\"><a href=\"https://mivietnam.vn/robot-hut-bui-lau-nha-dreame-d10s-plus/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(85, 85, 85);\"><strong>Dreame D10s Plus</strong></a>&nbsp;nổi bật với dock sạc tích hợp chế độ làm sạch với khả năng hút bụi rảnh tay lên đến 65 ngày* (* Dựa trên thực nghiệm của nhà sản xuất); Túi chứa bụi lớn 4L của D10s Plus với các cấp độ lọc E12, loại bỏ 99,5% các hạt mịn để ngăn bụi xâm nhập vào không khí; Cấu hình hút bụi DualBoost 1.0 của D10s Plus thu thập tóc, bụi bẩn và mảnh vụn một cách nhanh chóng và hiệu quả mà không bị tắc. Có D10s Plus giúp bạn tiết kiệm thời gian, việc dọn dẹp trở lên dễ dàng hơn.</p><p class=\"ql-align-justify\"><img src=\"https://mivietnam.vn/wp-content/uploads/2023/05/mivietnam-robot-hut-bui-d10s-plus-02.jpg\" alt=\"Robot Hút Bụi Lau Nhà Dreame D10S Plus\" height=\"1000\" width=\"1000\"></p><h2 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Dreame D10s Plus nâng cấp lực hút lên đến 5000Pa</strong></h2><p class=\"ql-align-justify\"><a href=\"https://mivietnam.vn/robot-hut-bui/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(85, 85, 85);\">Robot hút bụi thông minh</a>&nbsp;<strong>Dreame D10s Plus</strong>&nbsp;có lực hút lớn 5000Pa, giúp hút mọi bụi bẩn và mảnh vụn ra khỏi thảm hay trên sàn nhà một cách hiệu quả, bên cạnh đó robot còn được nâng cấp với bàn chải cao su chống rối tóc và lông thú cưng. Ngoài ra, D10s Plus mang đến cho bạn khả năng làm sạch toàn diện nhờ 3 chế độ làm sạch, 3 cấp độ kiểm soát lưu lượng nước và 4 cấp độ hút.</p><p class=\"ql-align-justify\"><img src=\"https://mivietnam.vn/wp-content/uploads/2023/05/mivietnam-robot-hut-bui-d10s-plus-03-2.jpg\" alt=\"Dreame D10s Plus nâng cấp lực hút lên đến 5000Pa\" height=\"1000\" width=\"1000\"></p><p class=\"ql-align-justify\"><img src=\"https://mivietnam.vn/wp-content/uploads/2023/05/mivietnam-robot-hut-bui-d10s-plus-04.jpg\" alt=\"Robot hút bụi lau nhà Dreame D10s Plus\" height=\"1134\" width=\"1000\"></p><h2 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Dreame D10s Plus tích hợp Camera AI và điều hướng LDS tiên tiến</strong></h2><p><br></p>',6990000,10000000,1,'Xiaomi','China','Robot hút bụi lau nhà',10,4,2),(13,'https://res.cloudinary.com/dec25/image/upload/v1683621225/open-market/olgu78tzfz01hexktbl1.jpg','NXB Trẻ','2023-05-09 15:33:44.940000','<p><span style=\"color: rgb(30, 136, 229); background-color: transparent;\"><img src=\"https://static.ybox.vn/2021/8/0/1629000655410-bia.png\"></span></p><p class=\"ql-align-justify\"><em>Nếu bạn đang tìm kiếm những câu chuyện biến các vấn đề toàn cầu về sự biệt lập, hạnh phúc và khủng hoảng định danh thành những cuộc phiêu lưu kỳ thú và bí ẩn, thì không cần tìm đâu xa, những cuốn sách của Haruki Murakami là dành cho bạn. Mặc dù bị ảnh hưởng mạnh mẽ bởi văn học phương Tây (như của Franz Kafka và Raymond Chandler) nhưng, các tác phẩm của Murakami vẫn phản ánh rõ nét văn hóa Nhật Bản, và có lẽ, đó là lý do tại sao những câu chuyện của ông vô cùng độc đáo.</em></p><p class=\"ql-align-justify\"><em>Không có một cuốn sách nào của Murakami đi theo lối đi thông thường, và đôi khi tính chất lập dị ấy đòi hỏi bạn phải đọc đi đọc lại nhiều lần trước khi hoàn toàn cảm nhận được cái hay của chúng. Nếu bạn đã từng đọc sách của Haruki Murakami, bạn hẳn sẽ biết rằng: bước vào thế giới sáng tác của Murakami giống như rơi xuống một cái hố mà bạn không thể, và quan trọng hơn là không muốn thoát ra.</em></p><p class=\"ql-align-justify\"><em>Phải xếp hạng những tác phẩm hấp dẫn này là một thách thức, nhưng sau khi suy nghĩ rất lâu, theo chúng mình, đây là danh sách những cuốn sách hay nhất của Haruki Murakami cho đến bây giờ:</em></p><p class=\"ql-align-justify\"><strong>1. Kafka on the Shore (2002) (<em>Tựa Việt: Kafka Bên Bờ Biển</em>)</strong></p><p class=\"ql-align-justify\">Bắt đầu danh sách của chúng mình là một cuốn sách bao gồm hai câu chuyện. Câu chuyện đầu tiên kể về Kafka Tamura, một cậu thiếu niên đang trong hành trình tìm kiếm người mẹ và người chị đã thất lạc từ lâu của mình. Câu chuyện thứ hai là về Nakata, một ông già đang đi tìm và trả lại những con mèo bị mất cho chủ nhân của chúng. Càng về sau khi cốt truyền được làm sáng tỏ, cuộc đời của hai con người này bắt đầu có những sự đan xen và kết nối.</p><p class=\"ql-align-justify\">Lần đầu tiên đọc&nbsp;<strong><em>“Kafka Bên Bờ Biển”</em></strong>, bạn có thể thấy hình thức hai câu chuyện sóng đôi có chút gì khó hiểu. Nhưng càng đi sâu vào câu chuyện, tính sóng đôi này lại càng có ý nghĩa, vì vậy, hãy kiên trì theo đuổi nó. Đó là sự kích thích tư duy, chính bản thân Murakami đã nói rằng cuốn sách chứa đầy những câu đố, những câu trả lời dành riêng cho bạn và trải nghiệm đọc sách của bạn. Một kiệt tác phức tạp như vậy, một trong những cuốn sách hay nhất từng được viết không thể nằm ở đâu khác ngoài vị trí đứng đầu danh sách.</p><p class=\"ql-align-justify\"><img src=\"https://static.ybox.vn/2021/8/0/1628999933734-1.jpg\"></p><p class=\"ql-align-justify\"><strong>2. The Wind-Up Bird Chronicle (1995)<em>&nbsp;(Tựa Việt: Biên Niên Ký Chim Vặn Dây Cót)</em></strong></p><p class=\"ql-align-justify\">Câu chuyện mở ra với một cặp vợ chồng sống trong thành phố đang nỗ lực tìm con mèo mất tích của họ (phải chăng Murakami đã đánh mất một con mèo?) Điều tưởng như bình thường này lại biến thành một việc lạ lùng chỉ có ở thế giới khác trong cuốn tiểu thuyết rất nổi tiếng này.&nbsp;<strong><em>“Biên Niên Ký Chim Vặn Dây Cót”</em></strong>&nbsp;được xuất bản tại Nhật Bản dưới dạng một bộ sách ba tập và gộp lại thành một cuốn sách duy nhất khi được dịch sang tiếng Anh. Từ những nhân vật kỳ quặc đến những thực tế đan xen, cốt truyện của cuốn sách này chắc chắn sẽ khiến bạn quay cuồng.</p><p class=\"ql-align-justify\">Trên hết, với phong cách điển hình của Murakami, câu chuyện ở ngưỡng điên rồ đã tô đậm các vấn đề trong xã hội Nhật Bản, chẳng hạn như sự cô độc, hành trình khám phá bản thân và quyền lực. Cuốn tiểu thuyết này đánh dấu sự thâm nhập ngoạn mục và sâu sắc hơn của Murakami vào lĩnh vực phê bình xã hội.<img src=\"https://static.ybox.vn/2021/8/0/1628998983755-2.png\"></p><p class=\"ql-align-justify\"><strong>3. A Wild Sheep Chase (1982)&nbsp;<em>(Tựa Việt: Cuộc Săn Cừu Hoang)</em></strong></p><p class=\"ql-align-justify\"><strong><em>“Cuộc Săn Cừu Hoang”&nbsp;</em></strong>thường được giới thiệu như một bước đệm cho những độc giả mới bắt đầu đọc sách của Murakami, bởi vì câu chuyện này ít giống như một mê cung hơn nhiều câu chuyện khác của ông. Nhưng đừng để bị lừa, việc kể về một nhân vật chính giấu tên đang tìm kiếm một con cừu toàn năng với một vết bớt kỳ lạ đi cùng với một người phụ nữ sở hữu đôi tai đẹp kỳ diệu vẫn khiến cuốn sách này khác xa lẽ thường.</p><p class=\"ql-align-justify\">Câu chuyện trinh thám kỳ lạ này thường được coi là tác phẩm quan trọng đầu tiên của Murakami. Tác giả đồng ý với điều đó, khi mô tả phần tiền truyện của cuốn sách này, cũng là hai cuốn tiểu thuyết đầu tiên của ông, là \"mỏng manh.\" Một phần sáng giá của&nbsp;<strong><em>“Cuộc Săn Cừu Hoang”&nbsp;</em></strong>là sự cân bằng giữa phức tạp và dễ tiếp cận, chủ nghĩa siêu thực nhưng vẫn dễ đọc, vì vậy ngay cả những người ít quen với phong cách kỳ lạ của Murakami cũng sẽ thích nó.<img src=\"https://static.ybox.vn/2021/8/0/1628999968482-3.jpg\"></p><p class=\"ql-align-justify\"><strong>4. Norwegian Wood (1987)&nbsp;<em>(Tựa Việt: Rừng Nauy)</em></strong></p><p class=\"ql-align-justify\">Thật khó để kể tên năm cuốn sách hàng đầu của Murakami mà không có cuốn tiểu thuyết đã đưa ông trở nên nổi tiếng trên phạm vi toàn cầu.&nbsp;<strong><em>“Rừng Nauy”</em></strong>&nbsp;không giống như những cuốn sách được chúng mình nhắc tới từ đầu đến giờ, bởi nó không theo chủ nghĩa siêu thực, thay vào đó là một câu chuyện đầy hoài niệm của một người đàn ông 30 tuổi hồi tưởng về cuộc sống thời đại học, mối tình đầu và nỗi đau của anh ấy dành cho những người thân yêu đã mất. Nghe có vẻ lạ đối với một cuốn tiểu thuyết của Murakam, phải không? Nhưng đừng vội bỏ qua nó - có khi cuốn sách lấy đi nước mắt này lại là một minh chứng thực sự cho tài hùng biện đáng ngạc nhiên của tác giả.<img src=\"https://static.ybox.vn/2021/8/0/1628999049783-4.png\"></p><p><br></p>',130000,200000,1,'NXB Trẻ','Việt Nam','Tựa sách của tác giả Murakami Haruki',6,10,2),(15,'https://res.cloudinary.com/dec25/image/upload/v1684164244/open-market/by2js1koaknncfummr0v.png','VINAMILK','2023-05-15 22:24:03.778000','<p>Sữa bột cho bé Optimum là thương hiệu đến từ Tập đoàn Vinamilk. Vinamilk là một trong những tập đoàn lớn hàng đầu tại Việt Nam chuyên về sữa và các sản phẩm dinh dưỡng. Sữa bột cho bé Optimum dành cho các bé từ sơ sinh đến 6 tuổi, giúp cung cấp dinh dưỡng đầy đủ cho bé phát triển khỏe mạnh và thông minh. Đây là thương hiệu sữa rất phù hợp với trẻ em Việt, được nhiều bố mẹ tin dùng cho con yêu của mình.&nbsp;Sữa bột Optimum Gold số 4 lon 850g giúp trẻ 2 - 6 tuổi hấp thu các dưỡng chất thiết yếu.</p><h3><strong>Ưu điểm sản phẩm</strong></h3><p><strong>Sữa bột Optimum Gold 4 850g&nbsp;</strong>với công thức dễ tiêu hóa, là nền tảng cho việc hấp thu các dưỡng chất thiết yếu cho trẻ từ 2 - 6 tuổi, giúp tăng cường sức đề kháng, phát triển não bộ và thể chất.</p><p>Sữa bột cho bé Optimum Gold 4 được các bà mẹ ưu tiên chọn lựa cho con, bởi vì:</p><ul><li><strong>HMO (2’- FL) l</strong>à prebiotic có cấu trúc tương tự&nbsp;<strong>như dưỡng chất được tìm thấy trong sữa mẹ</strong>, giúp hình thành hệ vi khuẩn có lợi, cùng với&nbsp;<strong>chất xơ hòa tan FOS</strong>&nbsp;giúp hỗ trợ hệ tiêu hóa khỏe mạnh.</li><li><strong>Đạm Whey giàu Alpha-lactalbumin và Probiotic BB-12 và LGG&nbsp;</strong>dễ tiêu hóa và giúp tăng vi khuẩn có lợi và khả năng hấp thu các dưỡng chất.</li><li><strong>Bổ sung hơn 25% DHA từ tảo&nbsp;</strong>, hỗ trợ phát triển não bộ và giúp đáp ứng hàm lượng theo khuyến nghị hằng ngày của các chuyên gia y tế Thế Giới FAO/WHO.</li><li>Ngoài ra, sữa bột cho bé&nbsp;Optimum còn có các vitamin, khoáng chất thiết yếu như&nbsp;<strong>A, D3, C, Kẽm, Selen và hỗn hợp Nucleotid</strong>&nbsp;giúp tăng cường sức đề kháng, hỗ trợ hệ miễn dịch của trẻ. Thêm&nbsp;<strong>Vitamin D và Canxi với tỉ lệ Canxi &amp; Phốt pho (Ca:P) thích hợp</strong>&nbsp;giúp trẻ phát triển tốt hệ xương và chiều cao.</li></ul><p><br></p><h3><span style=\"color: rgb(51, 51, 51);\"><img src=\"https://cdn.tgdd.vn/Products/Images//9079/235952/bhx/files/sua-bot-optimum-gold-4-lon-850g-202203231032285233.jpg\" alt=\"Sữa bột Optimum Gold số 4 lon 850g 0\"></span><strong>Đối tượng sử dụng</strong></h3><p><span style=\"color: rgb(51, 51, 51);\">Sữa bột Optimum Gold số 4 lon 850g dành cho trẻ từ 2 - 6 tuổi.</span></p><h3><strong>Hướng dẫn sử dụng</strong></h3><ul><li>Đun nước sôi khoảng 5 phút, sau đó để nguội đến mức còn âm ấm (khoảng 50C)</li><li>Rót 190 ml nước vào dụng cụ pha chế</li><li>Cho từ từ 6 muỗng gạt Optimum Gold (khoảng 38 g) vào dụng cụ pha chế</li><li>Khuấy đều cho đến khi bột tan hoàn toàn</li></ul><h3><strong>Cách bảo quản và lưu ý về sản phẩm</strong></h3><ul><li>Cần bảo quản nơi khô ráo, tránh ánh nắng mặt trời</li><li>Để xa tầm tay trẻ em</li><li>Sử dụng trong 4 tuần sau khi mở nắp hộp</li><li>Các dụng cụ pha chế phải được rửa sạch và tiệt trùng trước khi sử dụng.</li><li>Mỗi ngày nên uống 2 ly Optimum Gold 4 để cơ thể trẻ được cung cấp đầy đủ chất dinh dưỡng cần thiết</li></ul><p><br></p>',400000,600000,1,'VINAMILK','Việt Nam','Sữa Bột Cho Trẻ Dưới 7 Tuổi ',9,1,1),(16,'https://res.cloudinary.com/dec25/image/upload/v1684167579/open-market/ouejqp0s9avqi3bg1bxl.jpg','Mijia ','2023-05-15 23:19:38.986000','<p class=\"ql-align-justify\">Máy nước nóng để bàn Mijia C1 2.5L là sản phẩm hữu ích giúp làm nóng nước nhanh chóng, tiết kiệm điện. Bạn sẽ dễ dàng có một cốc nước với nhiệt độ mong muốn bất cứ lúc nào trong ngôi nhà của mình khi sở hữu chiếc máy này.</p><p><a href=\"https://mihanoi.vn/wp-content/uploads/2022/09/May-nuoc-nong-de-ban-Xiaomi-Mijia-C1-2.5L-S2201_5.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(10, 10, 10); background-color: transparent;\"><img src=\"https://mihanoi.vn/wp-content/uploads/2022/09/May-nuoc-nong-de-ban-Xiaomi-Mijia-C1-2.5L-S2201_5.jpg\" height=\"1000\" width=\"991\"></a></p><h3 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Điểm nổi bật của Máy nước nóng để bàn Mijia C1 2.5L</strong></h3><ul><li class=\"ql-align-justify\">Ngoại hình thanh lịch, nhỏ gọn, khả năng làm nóng nước chỉ trong 3 giây, cùng 3 mức nhiệt tùy chỉnh</li><li class=\"ql-align-justify\">Công nghệ làm nóng kép và 1 đường dẫn nước xoắn ốc độc đáo được thiết lập giữa 2 bộ phận làm nóng</li><li class=\"ql-align-justify\">Trang bị chế độ khóa nước độc lập để ngăn chặn trẻ em, đảm bảo an toàn cho người dùng.</li><li class=\"ql-align-justify\">Trang bị 2 định lượng nước đầu ra, bạn chỉ cần đặt cốc lên và nhấn</li><li class=\"ql-align-justify\">Trang bị chức năng ghi nhớ thể tích cốc. Bạn có thể nhanh chóng nháy đúp vào phím nhiệt độ nước tương ứng</li><li class=\"ql-align-justify\">Vòi phun nước khá cao thích hợp nhiều chiều cao cốc khác nhau</li></ul><h3 class=\"ql-align-justify\"><strong style=\"color: rgb(255, 102, 0);\">Làm nước nóng nhanh chóng</strong></h3><p><a href=\"https://mihanoi.vn/wp-content/uploads/2022/09/May-nuoc-nong-de-ban-Xiaomi-Mijia-C1-2.5L-S2201_2.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(10, 10, 10); background-color: transparent;\"><img src=\"https://mihanoi.vn/wp-content/uploads/2022/09/May-nuoc-nong-de-ban-Xiaomi-Mijia-C1-2.5L-S2201_2.jpg\" height=\"1000\" width=\"991\"></a></p><p class=\"ql-align-justify\">Máy nước nóng để bàn Mijia C1 sử dụng công nghệ làm nóng kép và 1 đường dẫn nước xoắn ốc độc đáo được thiết lập giữa 2 bộ phận làm nóng, để nước được làm nóng nhanh chóng và đồng đều trong quá trình chảy. Ngoài ra bộ phận làm nóng được bảo vệ bằng lớp cách nhiệt độc lập, an toàn và hiệu quả hơn. Với công suất hoạt động cao 2200W cho thời gian làm nóng nước của máy chỉ 3 giây, giúp bạn có ngay ly nước nóng một cách nhanh chóng, không phải chờ đợi lâu như các bình đun nước nóng truyền thống.</p><p><br></p>',1090000,2000000,1,'Mijia ','China','Máy nước nóng để bàn Xiaomi',10,2,2),(17,'https://res.cloudinary.com/dec25/image/upload/v1684168456/open-market/dsnfcm4xoeco4t91uwyg.jpg','XiaoMi','2023-05-15 23:34:15.481000','<p><br></p><p><br></p><p><br></p><p><img src=\"https://cdn.tgdd.vn/Files/2019/09/11/1197199/xiaomi-ra-mat-ao-khoac-chong-mua-moi-12-tui-co-the-tu-thay-doi-nhiet-do.jpg\" alt=\"Áo ULEEMARK của Xiaomi\" height=\"400\" width=\"730\"></p><p>Cụ thể, mẫu áo khoác này được&nbsp;<strong>sản xuất bởi Uleemark</strong>&nbsp;– một công ty mới tham gia vào hệ sinh thái của Xiaomi. Chiếc áo này được làm bằng lá vải, bạn vẫn có thể mặc được ngay cả khi thời tiết thay đổi đột ngột.</p><p>Mặt sau được làm bằng lớp lót phản nhiệt,<strong>&nbsp;tự động điều chỉnh nhiệt bên trong</strong>&nbsp;để giữ ấm cơ thể.&nbsp;Không chỉ vậy, loại vải này còn không thấm nước, siêu nhẹ và không bị bẩn.</p><p><img src=\"https://cdn.tgdd.vn/Files/2019/09/11/1197199/xiaomi-ra-mat-ao-khoac-chong-mua-moi-12-tui-co-the-tu-thay-doi-nhiet-do-1.jpg\" alt=\"Phía trong áo ULEEMARK\" height=\"400\" width=\"730\"></p><p>Áo khoác du lịch siêu lưu trữ đa chức năng dành cho nam của ULEEMARK có&nbsp;<strong>12 ngăn</strong>&nbsp;khác ngăn nhau để lưu trữ các thiết bị khác nhau như&nbsp;<a href=\"https://www.dienmayxanh.com/mat-kinh\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(22, 122, 198);\">mắt kính</a>,&nbsp;<a href=\"https://www.dienmayxanh.com/tai-nghe\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(22, 122, 198);\">tai nghe</a>, túi đựng&nbsp;<a href=\"https://www.dienmayxanh.com/dien-thoai\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(22, 122, 198);\">điện thoại di động</a>, túi lưu trữ lớn tích hợp, ngăn đựng thẻ,..... và một số ngăn được ẩn vào trong. Thậm chí còn có một ngăn đủ lớn để chứa cả một&nbsp;<a href=\"https://www.dienmayxanh.com/may-tinh-bang\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(22, 122, 198);\">máy tính bảng</a>.</p><p>Bên cạnh đó, chiếc áo này được thiết kế có&nbsp;<strong>gối hình chữ U bơm hơi</strong>&nbsp;và túi mặt nạ mắt 3 chiều chống chói giúp bạn có thể ngủ khi đi trên đường hoặc bất cứ khi nào bạn muốn.</p><p>Để đảm bảo an toàn cho người mặc, chiếc áo này cũng được trang bị các dải phản quang để tăng khả năng hiển thị vào ban đêm.</p>',700000,1000000,1,'XiaoMi','China','Áo Khoác Tự Thay Đổi Nhiệt Độ',10,3,2),(18,'https://res.cloudinary.com/dec25/image/upload/v1684585657/open-market/bov0aiynmgpqb0idev7x.jpg','Xiaomi','2023-05-20 19:27:35.883000','<h1 class=\"ql-align-center\"><span style=\"color: rgb(0, 56, 255);\">Mẫu Tivi Xiaomi Redmi Max 100 inch có gì đặc biệt?</span></h1><p>Redmi Max 100 inch là mẫu tivi có kích thước 100 inch đầu tiên của nhà Xiaomi. Ngoài thiết kế tràn viền cùng kích thước siêu khủng thì Max 100 còn được tích hợp nhiều công nghệ hiện đại cùng nhiều tính năng giúp người dùng đễ dàng sử dụng đồng thời mang tới những giây phút trải nghiệm tuyệt vời cho người dùng. Vậy những tính năng và công nghệ đó là gì? Hãy cùng&nbsp;<a href=\"https://migiasi.vn/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(50, 60, 66);\">https://migiasi.vn/</a>&nbsp;tìm hiểu trong bài viết dưới đây nha</p><h2>1. Thiết kế Tivi Xiaomi Redmi Max 100 inch</h2><p>Đầu tiên, khi nhìn vào tổng quan chiếc Tivi ta có thể thấy kích thước siêu khủng (100 inch) theo đó,&nbsp;<strong>Tivi Xiaomi Redmi Max 100 inch</strong>&nbsp;có mức cân năng tương ứng lên tới 63 kg. Do đó, Mẫu Tivi max 100 này thực sự phù hợp với những không gian rộng như phòng khách, phòng họp, hội trường, hội nghị và để trưng bày, ....</p><p>Nhìn tổng thể Max 100 được thiết kế với khung viền kim loại đi kèm 2 chân đế 1 cao, 1 thấp giúp người dùng tuỳ ý bày biện, thiết kế vị trí để theo ý muốn. Bên cạnh đó thiết kế viền màn hình siêu mỏng giúp tôn lên vẻ đẹp sang trọng/thanh lịch cho Tivi và không gian</p><p><img src=\"https://img.websosanh.vn/v2/users/review/images/kn0jat45y7irb.jpg?compress=85\" alt=\"tivi Xiaomi Redmi Max 100 inch\" height=\"361\" width=\"542\"></p><h2>2. Thiết kế màn hình&nbsp;</h2><p>Ngoài kích thước khổng lồ, chất lượng hình ảnh hiện thị trên&nbsp;<strong>Tivi Xiaomi Redmi Max 100 inch&nbsp;</strong>cũng được quan tâm khi trang bị ấm nền LCD cùng độ phân giải 4K (3840 x 2160). Tuy không phải là màn hình OLED nhưng màu sắc hiển thị vẫn vô cùng sắc nét sống động bởi&nbsp;94% dải màu DCI-P3 tương đương 1.07 tỷ&nbsp;màu cơ bản.&nbsp;</p><p><img src=\"https://img.websosanh.vn/v2/users/review/images/fmul70sfj8kjq.jpg?compress=85\" alt=\"xem phim đỉnh cao với màn hình lớn\" height=\"396\" width=\"695\"></p><p>Bên cạnh đó, tấm nền LCD này có độ sáng tối đa 700 nits không gây khó chịu cho người nhìn trong điều kiện ánh sáng chói kết hợp với góc nhìn rộng 178 °,&nbsp;đặc biệt là tần số quét 120Hz đi cùng công nghệ IMAX Enhanced được hỗ trợ mang đến những hình ảnh mượt mà, đã mắt mang tới trải nghiệm mượt mà, mới lạ/ thoải mái cho người dùng.</p><p class=\"ql-align-center\"><img src=\"https://migiasi.vn/image/catalog/3f90454b0a15848cc859bef97fbb2332.png\" height=\"246\" width=\"702\">&nbsp;</p><h2 class=\"ql-align-justify\">3. Hiệu ứng âm thanh vòm</h2><p class=\"ql-align-justify\">Với hệ thống loa kép có công suất tổng 30W và các công nghệ âm thanh như Dolby Audio, Dolby Atmos, DTS-HD&nbsp;thực sự mình thấy trang bị này không được ấn tượng. Chất lượng âm thanh sẽ chỉ đủ phục vụ ở mức giải trí cơ bản, xem phim, chương trình thực tế,… Còn nếu muốn trải nghiệm âm thanh thực sự sống động, đắm chìm vào từng giai điệu âm nhạc thì người dùng nên trang bị thêm bộ loa ngoài như soundsar hay là loa thùng.</p><h2 class=\"ql-align-justify\">4. Hiệu năng và tính năng sử dụng</h2><p class=\"ql-align-justify\">Với con chip CPU Cortex A73 4 nhân, RAM 4GB và bộ nhớ lưu trữ lớn 64GB Xiaomi tự tin cung cấp cho bạn một sức mạnh vận hành mượt mà đáng ngạc nhiên. Cùng với đó, là đa dạng cổng kết nối 3 Cổng HDMI, có hỗ trợ Variable Refresh Rate (VRR – Tần số quét biến thiên), 2 cổng USB-A 2.0. Theo đó, Xiaomi khẳng định Redmi Max 100 inch không chỉ hỗ trợ tốt giải trí hàng ngày mà còn hỗ trợ chơi game cực tốt.&nbsp;</p><p><img src=\"https://img.websosanh.vn/v2/users/review/images/e38ewfkdv18e5.jpg?compress=85\" alt=\"Xiaomi Redmi Max 86 inch\"></p><p>&nbsp;</p>',3000000,4000000,1,'Xiaomi.inc','Xiaomi','Tivi xiaomi EA55 - 4K HD',10,4,2),(19,'https://res.cloudinary.com/dec25/image/upload/v1684665629/open-market/j86geboscsmcmvjckkvz.jpg','Logitech','2023-05-21 17:40:30.732000','<h2 class=\"ql-align-justify\"><strong>Đánh giá chi tiết chuột Logitech G502 X Plus LightSpeed White</strong></h2><p class=\"ql-align-justify\"><a href=\"https://gearvn.com/collections/chuot-logitech\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(66, 139, 202);\">Chuột Logitech</a>&nbsp;G502 X PLUS White là sản phẩm mới nhất của series G502 đình đám. Được thiết kế lại và cải tiến với công nghệ chơi game hiện đại, bao gồm công tắc Lightforce lai quang học - cơ học&nbsp;đầu tiên, Lightspeed không dây, LIGHT SYNC RGB và cảm biến quang học Hero&nbsp;25K,&nbsp;<strong>Logitech G502 X PLUS&nbsp;</strong>chắc chắn là một trong những&nbsp;<a href=\"https://gearvn.com/collections/gaming-gear\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(66, 139, 202);\">gaming gear</a>&nbsp;đáng mua nhất cho game thủ thời gian sắp tới.</p><p class=\"ql-align-center\"><img src=\"https://file.hstatic.net/1000026716/file/gearvn-chuot-logitech-g502-x-plus-lightspeed-white-1_890b34211e5a458e89b10e5c495be118.png\" alt=\"GEARVN - Chuột Logitech G502 X Plus LightSpeed White\"></p><p class=\"ql-align-center\"><br></p><h3 class=\"ql-align-justify\"><strong>Switch LightForce lai quang học - cơ học</strong></h3><p class=\"ql-align-justify\">Các phím switch quang học lai cơ học đột phá, đạt được cấp độ mới về tốc độ và độ tin cậy thông qua kích hoạt quang học. Song song đó, kích hoạt cơ học giữ lại phản hồi rõ ràng, trực quan mà người chơi yêu thích.&nbsp;</p><h3 class=\"ql-align-justify\"><strong>Hỗ trợ đèn RGB Light Sync</strong></h3><p class=\"ql-align-justify\">Công nghệ RGB Light Sync cho phép chiếu sáng toàn phổ động với khả năng kiểm soát hoàn toàn khoảng 16,8 triệu màu sống động trong dãy 8 đèn LED. Tính năng phát hiện chơi chủ động&nbsp;sẽ tự động tắt đèn khi bạn dùng tay che nó, giúp tiết kiệm pin. Người dùng có thể tùy chỉnh mọi thứ trên&nbsp;phần mềm trực quan&nbsp;G HUB, bao gồm cá nhân hóa nâng cao và các hiệu ứng phương tiện khác trong \"hệ sinh thái\" của Logitech có thể kể đến như&nbsp;<a href=\"https://gearvn.com/collections/ban-phim-may-tinh\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(66, 139, 202);\">bàn phím</a>,&nbsp;<a href=\"https://gearvn.com/pages/tai-nghe-may-tinh\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(66, 139, 202);\">tai nghe máy tính</a>,....</p><p class=\"ql-align-center\"><img src=\"https://file.hstatic.net/1000026716/file/gearvn-chuot-logitech-g502-x-plus-lightspeed-white-3_4d40ff828e874d0abd2d5bd9030e8883.png\" alt=\"GEARVN - Chuột Logitech G502 X Plus LightSpeed White\"></p><p class=\"ql-align-center\"><br></p><h3 class=\"ql-align-justify\"><strong>Công nghệ Lightspeed không dây</strong></h3><p class=\"ql-align-justify\">Kết nối cấp độ chuyên nghiệp, hiện có giao thức được cập nhật, đáp ứng nhanh hơn 68% so với thế hệ trước. Với hiệu suất đáng kinh ngạc của công nghệ Lightspeed, Logitech G502 X PLUSđược đánh giá là một trong những dòng&nbsp;<a href=\"https://gearvn.com/collections/chuot-wireless\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: transparent; color: rgb(66, 139, 202);\">chuột không dây</a>&nbsp;sở hữu độ trễ cực thấp, tốc độ phản hồi cao. Đồng thời, có thể đạt được thời lượng pin lên đến 130 giờ khi tắt RGB và lên đến 37 giờ khi bật RGB.</p><p class=\"ql-align-center\"><img src=\"https://file.hstatic.net/1000026716/file/gearvn-chuot-logitech-g502-x-plus-lightspeed-white-4_6e0e0e5f371247bbb2539cd29daae072.png\" alt=\"GEARVN - Chuột Logitech G502 X Plus LightSpeed White\"></p><p><br></p>',700000,900000,1,'Logitech.Ftr','US','Chuột gaming Logitech - Nút Macro cho game',4,2,1),(20,'https://res.cloudinary.com/dec25/image/upload/v1687007582/open-market/phgfxgvpbmpiqbjnmlc9.png','Xiaomi','2023-06-17 20:13:02.743000','<p>Tivi là một trong những sản phẩm không chỉ mang tính giải trí cao mà còn rất quan trọng trong việc nâng tầm nội thất và không gian sống trong nhà. Một chiếc tivi nâng tầm chất lượng sống cần đáp ứng đủ các tiêu chí về chiều sâu ấn tượng, chất lượng khung hình chân thực, thiết kế bắt mắt và giá cả phải chăng. Tất cả những điều đó được hội tụ trong&nbsp;<strong style=\"color: rgb(0, 0, 0);\">Smart Tivi Xiaomi P1 55 inch</strong>&nbsp;– phiên bản tivi 55 inch của dòng Xiaomi P1 TV. Với độ phân giải chuẩn 4K Ultra HD, thiết kế tinh tế, sang trọng và được trang bị đầy đủ những công nghệ hình ảnh, âm thanh cùng các tính năng hữu ích cho người dùng, Smart Tivi Xiaomi P1 55 inch chính là sản phẩm Smart Tivi thuộc phân khúc tầm trung đáng để lựa chọn.</p><p><a href=\"https://mihanoi.vn/wp-content/uploads/2023/02/smart-tivi-xiaomi-p1-55-inch.jpg\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 0); background-color: transparent;\"><img src=\"https://mihanoi.vn/wp-content/uploads/2023/02/smart-tivi-xiaomi-p1-55-inch-800x800.jpg\" height=\"800\" width=\"800\"></a></p>',4000000,5000000,1,'Xiaomi.Inc','China','Smart Tivi 55 Inch - Xiaomi',4,11,3),(21,'https://res.cloudinary.com/dec25/image/upload/v1687007893/open-market/nsoedftfizvttwitbriz.webp','APPLE','2023-06-17 20:18:13.822000','<h2 class=\"ql-align-justify\"><strong style=\"color: rgb(54, 54, 54);\">Apple Watch Series 8 45mm GPS - Chống nước, chống nứt, chống bụi tiêu chuẩn cao</strong></h2><p class=\"ql-align-justify\">Apple Watch Series 8 45mm GPS là chiếc smartwatch sang trọng, được chế tác tinh xảo có khả năng chống nước và chống bụi. Đồng hồ được cải tiến nhiều tính năng đảm bảo độ chính xác khi theo dõi sức khỏe của người dùng. Bạn đã sẵn sàng tìm hiểu những điểm đặc biệt&nbsp;<a href=\"https://cellphones.com.vn/do-choi-cong-nghe/apple-watch/series-8.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: currentcolor;\"><strong>đồng hồ&nbsp;Apple watch Series 8</strong></a>&nbsp;này chưa, cùng mình tìm hiểu nhé!</p><h3 class=\"ql-align-justify\"><strong style=\"color: rgb(54, 54, 54);\">Màn hình lớn rực rỡ, hiển thị thông minh</strong></h3><p class=\"ql-align-justify\">Apple Watch S8 45mm GPS sở hữu màn hình 1.9 inch có độ phân giải 484x396 pixels vô cùng rực rỡ. Mặt đồng hồ được bảo vệ bởi lớp kính Ion-X strengthened glass, giúp Watch 8 đạt tiêu chuẩn chống nứt, chống nước IP6X và bụi WR50.</p><p class=\"ql-align-justify\">Các chi tiết đồng hồ trông tuyệt đẹp kết hợp với màn hình Retina Always - On sáng sủa khiến tổng thể trông vô cùng nổi bật. Chế độ Always-On cũng giúp bạn dễ dàng theo dõi các thông tin trên đồng hồ mà không cần phải chạm vào bề mặt hay ấn nút gì cả.</p><p class=\"ql-align-justify\"><img src=\"https://cdn2.cellphones.com.vn/x,webp,q100/media/wysiwyg/Watch/Apple/Apple-Watch-Series-8-45mm-GPS-6.jpg\" alt=\"Đánh giá màn hình Apple Watch Series 8 45mm GPS\"></p><p class=\"ql-align-justify\">&gt;&gt;&gt; Xem thêm mẫu đồng hồ&nbsp;<a href=\"https://cellphones.com.vn/apple-watch-series-8-41mm-4g.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(215, 0, 24);\">Apple Watch Series 8 41mm 4G</a>&nbsp;giá tốt tại CellphoneS.</p><h3 class=\"ql-align-justify\"><strong style=\"color: rgb(54, 54, 54);\">Nắm bắt thông tin sức khỏe bản thân</strong></h3><p class=\"ql-align-justify\">Apple Watch 8 45mm GPS tích hợp đầy đủ các tính năng chăm sóc sức khỏe, theo dõi và cung cấp các thông số cần thiết để người sử dụng nắm bắt. Bạn có thể đo nhịp tim, đo lượng calories tiêu thụ, đo oxy trong máu, điện tâm đồ, chu kỳ kinh,...</p><p class=\"ql-align-justify\">Các thông tin này giúp bạn hiểu rõ hơn về sức khỏe bản thân và có lời khuyên thích hợp để bạn cải tiến sức khỏe đúng hướng. Thiết bị hỗ trợ người dùng tự tập luyện thể thao với các bài tập đa dạng hiệu quả như bơi, đi bộ, tập yoga, chạy bộ,...</p><p class=\"ql-align-justify\"><img src=\"https://cdn2.cellphones.com.vn/x,webp,q100/media/wysiwyg/Watch/Apple/Apple-Watch-Series-8-45mm-GPS-4.jpg\" alt=\"Đánh giá Apple Watch Series 8 45mm GPS\"></p><p class=\"ql-align-justify\">Đồng hồ cũng giúp phát hiện những tai nạn và biến cố xảy ra đối với người thân và liên lạc tìm sự trợ giúp để bảo vệ cho bạn. Cảm biến nhiệt độ giúp theo dõi nhiệt độ cơ thể để nhận biết chu kỳ rụng trứng, hỗ trợ hiệu quả kế hoạch hóa gia đình.&nbsp;</p><p><br></p>',1000000,3000000,1,'APPLE','US','Apple Watch Series 8 45mm GPS',4,13,6),(22,'https://res.cloudinary.com/dec25/image/upload/v1687008324/open-market/kwhqpev6j2f1y7kaifv7.jpg','Samsung','2023-06-17 20:25:24.941000','<h3 class=\"ql-align-justify\"><strong style=\"color: rgb(54, 54, 54);\">Thiết kế công thái học cho trải nghiệm đeo thoải mái và hoàn hảo</strong></h3><p class=\"ql-align-justify\"><a href=\"https://cellphones.com.vn/thiet-bi-am-thanh/tai-nghe/tai-nghe-bluetooth.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(215, 0, 24);\">Tai nghe không dây bluetooth</a>&nbsp;Samsung Galaxy Buds Pro sở hữu một thiết kế bầu dục, khác với thiết kế bo tròn trên thế hệ tiền nhiệm. Được phủ thêm một lớp sơn bóng giúp làm nổi bật thiết kế của tai nghe thêm phần bắt mắt, nổi bật dưới mọi góc nhìn.</p><p class=\"ql-align-justify\"><img src=\"https://cdn2.cellphones.com.vn/x,webp,q100/media/wysiwyg/accessories/earphone/galaxy-buds-pro-1.JPG\" alt=\"Thiết kế công thái học cho trải nghiệm đeo thoải mái và hoàn hảo\"></p><p class=\"ql-align-justify\">Thiết kế công thái học với kích thước nhỏ gọn, vừa vặn ôm khí đôi tai của người dùng. Giúp bạn trải nghiệm cảm giác thoải mái và dễ chịu cả ngày dài cùng giai điệu âm thanh mà Galaxy Buds Pro mang đến.</p><h3 class=\"ql-align-justify\"><strong style=\"color: rgb(54, 54, 54);\">Chống ồn chủ động ANC, làm chủ âm thanh mà bạn mong muốn</strong></h3><p class=\"ql-align-justify\">Samsung tích hợp cho tai nghe Bluetooth Samsung Galaxy Buds Pro công nghệ chống ồn chủ động ANC tiên tiến. Giúp lọc tạp âm hiệu quả để bạn có thể thưởng thức âm thanh, nhận thông báo tin nhắn và gọi thoại với chất lượng tốt nhất.</p><p class=\"ql-align-justify\"><img src=\"https://cdn2.cellphones.com.vn/x,webp,q100/media/wysiwyg/accessories/earphone/galaxy-buds-pro-2.JPG\" alt=\"Chống ồn chủ động ANC, làm chủ âm thanh mà bạn mong muốn\"></p><p class=\"ql-align-justify\">Người dùng có thể dễ dàng bật tắt tính năng chống ồn chủ động trên Galaxy Buds Pro nhanh chóng. Làm chủ âm thanh mà bạn mong muốn giờ đây dễ dàng hơn bao giờ hết.</p><p class=\"ql-align-justify\">Ngoài ra, bạn có thể xem thêm:&nbsp;<a href=\"https://cellphones.com.vn/samsung-galaxy-buds-pro-2.html\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(215, 0, 24);\">Tai nghe Samsung Galaxy Buds Pro 2 chính hãng</a>, sắp được lên kệ trên toàn quốc.</p><h3 class=\"ql-align-justify\"><strong style=\"color: rgb(54, 54, 54);\">Màng loa 12nm mang đến chất âm sống động, tinh chỉnh bởi AKG</strong></h3><p class=\"ql-align-justify\">Tận hưởng chất âm lôi cuốn, sôi động trên tai nghe không dây Samsung Galaxy Buds Pro nhờ sự kết hợp hoàn hảo giữa màng loa 12nm được tinh chỉnh bởi AKG. Chất âm cho ra luôn sáng rõ và chân thực nhất.</p><p class=\"ql-align-justify\"><img src=\"https://cdn2.cellphones.com.vn/x,webp,q100/media/wysiwyg/accessories/earphone/galaxy-buds-pro-7.jpg\" alt=\"Màng loa 12nm mang đến chất âm sống động, tinh chỉnh bởi AKG\"></p><p class=\"ql-align-justify\">Ngoài ra driver lớn cùng ống bass giúp tăng cường âm thanh ở tần số thấp hơn, cho âm thanh lớn và vang vọng. Nâng cao chất lượng những bản nhạc nhưng đang nghe trong khán phòng.</p><p><br></p>',2000000,3000000,1,'Samsung','China','Tai nghe không dây Samsung Galaxy Buds Pro',4,2,2),(23,'https://res.cloudinary.com/dec25/image/upload/v1687008911/open-market/ea0yesjewlfm93ambuic.jpg','Dương Hữu Thành','2023-06-17 20:35:11.685000','<p><span style=\"color: rgb(36, 36, 36);\">Nội dung cuốn sách được thể hiện gồm những chương như sau:</span></p><p><span style=\"color: rgb(36, 36, 36);\">Chương I. Giới thiệu ngôn ngữ Java, trình bày sơ lược lịch sử hình thành và phát triển Java, những đặc trưng nổi bật của ngôn ngữ Java</span></p><p><span style=\"color: rgb(36, 36, 36);\">Chương II. Lập trình Java căn bản, trình bày những kiến thức căn bản lập trình Java và một số kiến thức nâng cao như lập trình tổng quát, biểu thức chính quy</span></p><p><span style=\"color: rgb(36, 36, 36);\">Chương III. Lập trình 139 với JavaFX: Trình bày việc triển khai ứng dụng RIA với công nghệ JvaFX</span></p><p><span style=\"color: rgb(36, 36, 36);\">Chương IV. Lập trình cơ sở dữ liệu: Trình bày tương tác với cơ sở dữ liệu trong Java bằng JDBC và hibernate</span></p><p><span style=\"color: rgb(36, 36, 36);\">Chương V. Phát triển ứng dụng Web: Trình bày việc ứng dựng Web bằng JSF</span></p>',180000,210000,1,'NXB TT&TT','Việt Nam','Lập trình JAVA - Dương Hữu Thành',6,10,1),(24,'https://res.cloudinary.com/dec25/image/upload/v1687022785/open-market/foyequi8j48ghfhwyt74.jpg','Nike','2023-06-18 00:26:26.216000','<h4><strong>ÁO ĐẤU CHELSEA SÂN NHÀ PLAYER 2022-2023 BODYFIT THAILAND - CHELSEA HOME KIT 2022/23</strong></h4><p><strong><em>Áo đấu chelsea sân nhà màu xanh, bản cao cấp nhất nhập khẩu từ Thái Lan, phom dáng bodyfit ôm gọn cơ thể, vân vải dệt kim nổi 3d trên thân áo, logo ép 